Defendant in custody.   
Count 1 - Obstruct Officer - No contest plea.  Convicted.  State moves to dismiss and read in count 2, possess drug paraphernalia as repeater and count 3, possess illegally obtained prescription.   Motion granted.   Sentence is withheld.   Defendant is placed on probation to DOC for two (2) years.   Conditions of probation are:
1) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
2) AODA assessment and follow through; 
3) Maintain full-time employment, schooling combination;
4) Submit DNA sample and surcharge;
5) Pay costs of action; 
6) Pay supervision fees in an amount to be determined by DOC; 
7) Maintain absolute sobriety;
8) Submit to random urine screens and pay for same; 
9) Have no contact with any drug dealers;
10) Use only one doctor and one pharmacy.  
Minutes.
